                controlId="formGridName"
              >
                <Form.Label>ผุ้แจ้งการรายงาน : {usernamePost && usernamePost[0].username} </Form.Label>
              </Form.Group>

              <Form.Group>
                <span className="spanhistory">
                  {/* {ok.name} {ok.surname} */}
                </span>
              </Form.Group>
            </Form.Row>
          </Form>
        </div>
      </div>
    </div>
  );
};

export default Non_listverifypost;
